Falling For You
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Cast: Jesse Jane   Missy Martinez   Manuel Ferrara   Erik Everhard   Tommy Gunn   Ella Milano   Pressley Carter  

Categories: Couples, Feature

Description: Jesse Jane loves her life living with friends Manuel Ferrara and Erik Everhard. Her boyfriend, Tommy Gunn on the other hand isn't too happy with her. Though they share an amazing sex life, Tommy seems over the relationship. As a tennis instructor, Manuel is at the mercy of his horny student Missy Martinez who loves to play with his racket and balls. He needs to keep dipping into her to make sure he makes ends meet. For Erik to make rent, he buys a massage table with hopes of a new income. Instead, he is the recipient of happy endings by super hotties Pressley Carter and Ella Milano. After things fall apart between Jesse and Tommy, will Manuel and Jesse realize they were meant for each other?

